import './App.css';

function App() {
  return (
    <div className="App">
      <div class="doc-page">
        <div class="header">
          <a href="#">Home</a>
          <a href="#">About</a>
          <a href="#">Contact Us</a>
          <a href="#">Profile</a>
        </div>
      </div>
    </div>
  );
}

export default App;
